import React from 'react'

class Form extends React.Component {
  render() {
    const { children } = this.props
    return (
      <div className={'form'}>
        {children}
        <style jsx>{`
          .form {
            margin-bottom: 0px;
            display: flex;
            flex-direction: row;
            justify-content: flex-start;
            align-items: center;
          }
        `}</style>
      </div>
    )
  }
}

export default Form
